import Card from 'react-bootstrap/Card';
import { CgNotes } from "react-icons/cg";

const EmployeeMeeting = ({ date, topic }) => {

    return (
        <Card className="mb-4">
            <Card.Body>
                <div className="d-flex justify-content-between">
                    <div className="d-flex flex-column align-items-start">
                        <Card.Text className="mb-0">
                            {topic}
                        </Card.Text>
                        <small className="mt-2 small-text">
                            {date}
                        </small>
                    </div>
                    <div className="vote-buttons">
                        <div className="d-flex mb-2">
                            <button>See Cricket Poll</button>
                            <button onClick={() => console.log('see summary')}><CgNotes /></button>
                            <button>Watch Recording</button>
                        </div>
                    </div>
                </div>
            </Card.Body>
        </Card>
    );
}

export default EmployeeMeeting;
